    var collision;
    var Width = 32;
    var Height = 32;
    var colBlockNum = 0;
    var totalTiles = 0;

    function run() {
        initialize(console.log("init map"));
        //print();
    }

    function initialize(callback) {
        settings = prison.settings;
        rows = prison.settings.rows;
        cols = prison.settings.cols;

        fillWalls();
        console.log("---Map Fully Created---");

        if (callback) {
            callback();
        }

    }

    function randomItem() {
        var randprison = Math.floor(Math.random() * numprisonTypes);
        //console.log("Created a random prison: " + randprison);
        return randprison;
    }

    function fillWalls() {
        walls = [];
        var mp = 0;
        for (var x = 0; x < cols; x++) {
            walls[x] = [];
            for (var y = 0; y < rows; y++) {
                type = wallArray[mp];
                walls[x][y] = type;
                mp++;
            }
        }
        setCollision();
       // console.log("Completed mapping tiles!");
    }

    function print() {
        var str = "\n";
        for (var y = 0; y < rows; y++) {
            str += "";
            for (var x = 0; x < cols; x++) {

                str += getprison(x, y) + " ";
            }
            str += "\r\n";
        }
        console.log(str);
    }

    function setCollision() {
        collision = [];
        
        for(var x = 0; x < cols; x++)
        {
            
            collision[x] = [];
            for(var y = 0; y < rows; y++)
            {
                switch (walls[y][x])
                {
                    case 0:
                        collision[x][y] = { Type: "0" }
                        totalTiles++;
                        break;
                    default:

                        colBlockNum++;
                        var X   = x * Width;
                        var Y   = y * Height;
                        var Hw  = Width / 2;
                        var Hh  = Height / 2;
                        var Cx  = X + Hw;
                        var Cy  = Y + Hh;
                        
                        collision[x][y]={   
                                            X:          X,              //For 32 tile width
                                            Y:          Y,
                                            Hw:         Hw,
                                            Hh:         Hh,
                                            Cx:         Cx,             //Center X
                                            Cy:         Cy,             //Center Y
                                            Type:       "Block"
                                        };
                        //console.log(walls[y][x] + "cor->X:" + x + " Y:" + y + " -->PX =" + x * 32 + "x" + y * 32);
                        totalTiles++;
                        break;
                }
            }
        }
        //console.log("cor->CX:" + collision[0].Cx + " CY:" + collision[0].Cy + " MAG: " + collision[0].Mag);
        console.log("Total Collision Blocks: " + colBlockNum);
        console.log("Total Blocks: " + totalTiles);
        //console.log("1st element" + collision[0].X + "x" + collision[0].Y);
    }

    function getColBlockNum()
    {
        return totalTiles;
    }

    function getCollisions()
    {
        return collision;
    }

